import React,{Component} from 'react';

import './pages/navbar.css';

class Navbar extends Component{
    render() {
        return(
            <nav>
                <img className="" src={logoBmw} alt="Logo Bmw"/>
            </nav>
        )
    }
}

export default Navbar
